    .pw-panel-resizer__orientation_bottom {
      top: -8px

    .pw-panel-resizer__orientation_top {
      left: 0;
      width: 100%;
      height: 8px
    }

    .pw-panel-resizer__orientation_left {
      right: -8px
    }

    .pw-panel-resizer__orientation_right {
      left: -8px
    }

      height: 100%;
      top: 0;
      width: 8px;
      cursor: e-resize
